import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import Login from './pages/Login/Login';
import Profile from './pages/Profile/Profile';

function App() {
    return (
        <Router>
            <div>
                <Link to="/">Login</Link>
            </div>

            <Switch>
                <Route path="/profile">
                    <Profile />
                </Route>
                <Route path="/">
                    <Login />
                </Route>
            </Switch>
        </Router>
    );
}

export default App;
